import * as React from 'react';
import { DataGrid } from '@mui/x-data-grid';
import { Box, Typography } from '@mui/material';

// Define your columns
const columns = [
  { field: 'grid', headerName: 'Grid', width: 110 },
  { field: 'diode', headerName: 'Diode', width: 110 },
  { field: 'unmask', headerName: 'Unmask', width: 110 },
  { field: 'ru', headerName: 'RU', width: 110 },
  { field: 'seatUuidPart1', headerName: 'Seat UUID Part 1', width: 110 },
  { field: 'seatUuidPart2', headerName: 'Seat UUID Part 2', width: 110 },
  { field: 'seatUuidPart3', headerName: 'Seat UUID Part 3', width: 110 },
  { field: 'ru2', headerName: 'RU', width: 110 },
  { field: 'unmask2', headerName: 'Unmask', width: 110 },
  { field: 'diode2', headerName: 'Diode', width: 110 },
  { field: 'grid2', headerName: 'Grid', width: 110 },
];

// Generate your row data
const rows = [];
for (let i = 1; i <= 40; i++) {
  rows.push({
    id: i,
    grid: i,
    diode: `Diode ${i}`,
    unmask: i % 2 === 0 ? 'Yes' : 'No',
    ru: i,
    seatUuidPart1: `Part1-${i}`,
    seatUuidPart2: `Part2-${i}`,
    seatUuidPart3: `Part3-${i}`,
    ru2: i,
    unmask2: i % 2 === 0 ? 'Yes' : 'No',
    diode2: `Diode ${i}`,
    grid2: i,
  });
}

// Insert a 'MIDHALF' row after 20 rows
rows.splice(20, 0, {
  id: 'midhalf',
  grid: 'MIDHALF',
  diode: '',
  unmask: '',
  ru: '',
  seatUuidPart1: '',
  seatUuidPart2: '',
  seatUuidPart3: '',
  ru2: '',
  unmask2: '',
  diode2: '',
  grid2: '',
});

function App() {
  return (
    <Box sx={{ height: 700, width: '100%' }}>
      <Typography variant="h6" component="div" gutterBottom sx={{ textAlign: 'center', p: 2, backgroundColor: 'primary.dark', color: 'common.white' }}>
        TAPE-IN DB VIEW
      </Typography>
      <DataGrid
        rows={rows}
        columns={columns}
        pageSize={22}
        rowsPerPageOptions={[22]}
        checkboxSelection
        disableSelectionOnClick
        getRowClassName={(params) =>
          `super-app ${params.row.grid === 'MIDHALF' ? 'midhalf' : ''}`
        }
      />
    </Box>
  );
}
export default App;


